def knows(a: int, b: int) -> bool:
    return graph[a][b]


class Solution:

    def findCelebrity(self, n: int) -> int:

        for j in range(n):
            if knows(0, j):
                ii = True
                for i in range(0, n):
                    if i != j and (not knows(i, j) or knows(j, i)):
                        ii = False
                        break
                if ii: return j
        return -1


def log(func):
    def wrapper(*args, **kw):
        from datetime import datetime 
        time_start = datetime.now()
        #print('call %s():' % func.__name__)
        r = func(*args, **kw)
        time_end = datetime.now()
        print("---\ntime cost:",time_end-time_start)
        return r
    return wrapper

@log
def run(*args, **kw):
    so = Solution()
    r = so.findCelebrity(*args, **kw)
    print(r)

